<script>
export default {
    data() {
        return {
            events: [],
            eventSource: null,
            appId: '',
            modelId: '',
            modelName: '',
            talkContent: '',
            talkArray: [
                // {
                //     role: 'user',
                //     content: '鱼是怎么进食的?'
                // },
                // {
                //     role: 'assistant',
                //     content: '吞食，所谓的吞食，就是通过躯体来带动水流，从而让食物和泥沙从水底卷起，然后大口吞食食物和泥沙，让水流把不能进食的物质从鱼鳃的下面直接冲出去，保留食物进鱼喉，一般中底层的杂食鱼类一般都习惯这种进食方法，所以在垂钓鲫鲤这类杂食鱼时，如果用双钩的话都要保留一定的钩距，就是未免吞食时双钩有可能造成一定的挡口从而影响进食效果。所以这种鱼，在作钓时，一般多注重饵料味型和状态，能方便的诱鱼吞食，基本上就有非常大的把握上鱼'
                // }
            ]
        }
    },
    // 挂载完成，可访问DOM元素
    mounted() {
        this.appId = this.$route?.query?.id
        this.modelId = this.$route?.query?.modelId
        this.modelName = this.$route?.query?.modelName
    },
    beforeDestroy() {
        // 组件销毁前停止 EventSource
        this.stopEventSource();
    },
    methods: {
        startEventSource() {
            if (!this.eventSource) {
                this.eventSource = new EventSource('/chat');
                this.eventSource.onmessage = this.handleMessage;
                this.eventSource.onerror = this.handleError;
            }
        },
        stopEventSource() {
            if (this.eventSource) {
                this.eventSource.close();
                this.eventSource = null;
            }
        },
        handleMessage(event) {
            // 处理接收到的消息
            console.log('收到消息:', event.data);
            this.events.push({ id: this.events.length, data: event.data });
        },
        handleError(event) {
            // 处理错误
            console.error('EventSource 错误:', event);
            this.stopEventSource();
        },
        // 处理回车键触发的事件逻辑

        handleSubmit() {
            if (!this.appId) {
                this.$message.warning('数据异常!无法聊天')
            }
            let base64Image = ""
            //{"object":"chat.completion","choices":[{"index":0,"message":{"role":"assistant","content":"在一个遥远的星球上，有一个美丽的国度叫梦幻王国。那里有七色花、会说话的动物和神奇的魔法。国王和王后有一个独生女，名叫小公主。她聪明伶俐，深受两国人民的喜爱。\n\n有一天，邪恶势力企图摧毁梦幻王国。为了拯救国家，小公主踏上了一段充满挑战的旅程。她在途中结识了勇敢的矮人战士、机智的狐狸和忠诚的狮子。五人结","name":null,"function_call":null},"finish_reason":"stop"}],"created":1717126051,"usage":{"prompt_tokens":54,"total_tokens":154,"completion_tokens":100}}
            let url = '/project/maas/modelapp/modelapplist/talikToAi'
            this.talkArray.push({
                role: 'user',
                content: this.talkContent,
                image_url: ''
            },)
            //此时必须异步执行滚动条滑动至底部
            setTimeout(() => {
                this.$refs.chatBody.scrollTop = this.$refs.chatBody.scrollHeight;
            }, 0)
            let nowTalkContent = this.talkContent
            this.talkContent = ''
            this.post(url, {
                id: this.appId,
                content: nowTalkContent,
                nowTalks: this.talkArray
            }, {
                headers: {
                    'Content-Type': 'application/json'
                }
            }).then((res) => {
                if (res?.bean) {
                    let results = res.bean.choices
                    if (results.length == 1) {
                        this.talkArray.push({
                            role: 'assistant',
                            content: results[0].message.content
                        })
                        //此时必须异步执行滚动条滑动至底部
                        setTimeout(() => {
                            this.$refs.chatBody.scrollTop = this.$refs.chatBody.scrollHeight;
                        }, 0)
                    } else {
                        this.talkArray.push({
                            role: 'assistant',
                            content: '生成失败!请联系管理员!'
                        })
                    }

                } else {
                    this.$message.error(`对话失败!请联系管理员!`)
                }
            }).finally(() => {

            })
        },
    }
}
</script>
